// @author Marc Yin
// @license GNU GENERAL PUBLIC LICENSE V3
// @match https://code.earthengine.google.com/*
// @icon data:image/png;base64,
// @run-at document-end
// @grant none
// ==/UserScript==


// create element
function ce(n) { return document.createElement(n); } // end of function

// add style
function addStyle(css) {
    var head = document.head || document.getElementsByTagName('head')[0];
    if (head) {
        var style = ce("style");
        style.type = "text/css";
        style.appendChild(document.createTextNode(css));
        head.appendChild(style);
    } // end if
} // end of function

// global variables
var position,
// figure out if this is moz || IE because they use documentElement
el = (navigator.userAgent.indexOf('Firefox') != -1 || navigator.userAgent.indexOf('MSIE') != -1) ? document.documentElement : document.body,
// timer
t1, t2,
// z-index
zIindex = 1001;       // edit this value

function click1(item, index) {
  item.children[2].click();
}
function click2(item, index) {
  item.click();
}
function click3(item, index) {
  item.children[3].click();
}

function click_ok(){
    var ok = Array.from(document.getElementsByClassName('goog-buttonset-default goog-buttonset-action'));
    ok.forEach(click2);
}
function whenAvailable(callback) {
    var interval = 10; // ms
    var assets = document.getElementsByClassName('asset-id-root-select')
    var loaded = 0
    for (var i = 0; i < assets.length; i++) {
        if (assets[i].textContent.includes("users/")){
            loaded += 1
            console.log(assets[i].textContent)
        }
    }
    setTimeout(function() {
        if (loaded>assets.length-1) {
            callback();
        } else {
            setTimeout(whenAvailable(callback), interval);
        }
    }, interval);
}

// submit
function submit() {
  var tasks1 = Array.from(document.getElementsByClassName('task local type-EXPORT_IMAGE awaiting-user-config'));
  var tasks2 = Array.from(document.getElementsByClassName('task local type-EXPORT_FEATURES awaiting-user-config'));
  var tasks = tasks1.concat(tasks2)
  // console.log(tasks)
  tasks.forEach(click1);
  var assets = document.getElementsByClassName('asset-id-root-select')
  if (assets.length > 0) {
      whenAvailable(click_ok)
  }else{
      click_ok()
  }

} // end of function

// cancel running
function cancel_running() {
    var tasks1 = Array.from(document.getElementsByClassName('task local type-EXPORT_IMAGE running-on-backend'));
    var tasks2 = Array.from(document.getElementsByClassName('task local type-EXPORT_FEATURES running-on-backend'));
    var tasks3 = Array.from(document.getElementsByClassName('task remote type-EXPORT_IMAGE running-on-backend'));
    var tasks4 = Array.from(document.getElementsByClassName('task remote type-EXPORT_FEATURES running-on-backend'));
    var tasks = tasks1.concat(tasks2).concat(tasks3).concat(tasks4);
    tasks.forEach(click3);
    // console.log(tasks)
    click_ok()
} // end of function

// cancel unrunning
function cancel() {
    var tasks1 = Array.from(document.getElementsByClassName('task local type-EXPORT_IMAGE submitted-to-backend'));
    var tasks2 = Array.from(document.getElementsByClassName('task remote type-EXPORT_IMAGE submitted-to-backend'));
    var tasks3 = Array.from(document.getElementsByClassName('task local type-EXPORT_FEATURES submitted-to-backend'));
    var tasks4 = Array.from(document.getElementsByClassName('task remote type-EXPORT_FEATURES submitted-to-backend'));
    var tasks = tasks1.concat(tasks2).concat(tasks3).concat(tasks4);
    tasks.forEach(click3);
    // console.log(tasks)
    click_ok()
} // end of function


function shareCSS(){
    // variables
    var s='', img_submit, img_cancel, img_cancel_running;

	// img vs button
    img_submit = 'data:image/png;base64,';
	img_cancel = 'data:image/png;base64,';
    img_cancel_running = 'data:image/png;base64,';
    // button id
    s+='#submit { position:fixed; right:400px; top:43px;   z-index:'+zIindex+'; height:26px; width:78px; cursor:pointer; background:url('+img_submit+') no-repeat scroll 50% 50% rgba(0, 0, 0, 0); border-radius:5px 0 0 5px; margin-top:-24px; }';
    s+='#cancel { position:fixed; right:310px; top:43px;   z-index:'+zIindex+'; height:26px; width:78px; cursor:pointer; background:url('+img_cancel+') no-repeat scroll 50% 50% rgba(0, 0, 0, 0); border-radius:5px 0 0 5px; margin-top:-24px; }';
    s+='#cancel_running { position:fixed; right:156px; top:43px;   z-index:'+zIindex+'; height:26px; width:142px; cursor:pointer; background:url('+img_cancel_running+') no-repeat scroll 50% 50% rgba(0, 0, 0, 0); border-radius:5px 0 0 5px; margin-top:-24px; }';
    // button class
    s+='.play_btn { -webkit-transition-duration:0.5s linear; -o-transition-duration:0.5s linear; -moz-transition-duration:0.5s linear; transition-duration:0.5s linear; opacity:0.65; }';
    s+='.play_btn:hover { opacity:1; }';
	// append
    addStyle(''+s);
} // end of function

// main
function create_btn_element() {
    // get scroll
	var sub, can, canr,
	    scrolled;
	shareCSS();

	// if
	if(el){
		// create DOM element
		sub = ce('span');
		can = ce('span');
        canr = ce('span');
		// set attribute
		sub.setAttribute('id','submit');
		can.setAttribute('id','cancel');
        canr.setAttribute('id','cancel_running');
		// set class
		sub.className = "play_btn";
		can.className = "play_btn";
        canr.className = "play_btn";
        // append element
		document.body.appendChild(sub);
		document.body.appendChild(can);
        document.body.appendChild(canr);

		// add event over
		sub.addEventListener('click', submit, false);
		can.addEventListener('click', cancel, false);
        canr.addEventListener('click', cancel_running, false);
		// add event out

	} // end if
} // end of function

// run it
create_btn_element();